import React from 'react';
import ArticlesList from '../components/ArticlesList';
import TweetInfo from "../components/TweetInfo";

const ArticlesListPage = () => ( 
    
    <>
    <h1>Articles</h1>
    <h1><TweetInfo /></h1>
    <ArticlesList />
    </>
    

);

export default ArticlesListPage;
